import './App.css';

function App() {
  return (
    <div className="App">
      <User />
    </div>
  );
}
const User = () => {
  return(
    <div>
      <h1>Adrian</h1>
      <h2>20</h2>
      <h2>adrian@adrian.com</h2>    
    </div>
  );
}
export default App;
